import React, { useState } from 'react';
import Calendar from 'react-calendar';

class ScheduleCalendar extends React.Component {
  constructor(props) {
    super(props);
    {
      this.state = {};
    }
  }

  render() {
    return (
      <div>
        <Calendar onChange={onChange} value={value} />
      </div>
    );
  }
}

export default ScheduleCalendar;
